----------------------------------------------------------
-- Sequences and triggers
----------------------------------------------------------

DROP SEQUENCE DQM_SVG_ID;
/

CREATE SEQUENCE DQM_SVG_ID  MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 1 START WITH 1 CACHE 20 NOORDER  NOCYCLE ;
/

create or replace trigger DQM_SVG_ID_TRG     
before insert on "DQM_SEVERITY_GROUP"    
for each row begin     
  if inserting then       
    if :NEW."SVG_ID" is null then          
      select DQM_SVG_ID.nextval into :NEW."SVG_ID" from dual;       
    end if;    
  end if; 
end;
/

